    #map path {
        fill: #c4c4cb;
        stroke: #FFFFFF;
        stroke-width: 0.6;
        transition: fill 0.2s, stroke 0.3s;
        z-index: 1000;
        transition: fill 2s;
        fill-opacity : 1;
    }

    #map.animated path.selected {
        /.animated*stroke: #000000;*/
        /*stroke-width: 1.5;*/
        transition: fill 0.2s, stroke 0.3s;
        z-index: 9000;
        fill-opacity : 0.6;
        animation: blinker 1.5s linear infinite;
    }

    @keyframes blinker {
        50% {
            stroke-width: 1;
            fill-opacity : 0.5;
        }
    }

    #map path:hover {
        stroke-width: 1.1;
        fill-opacity : 1;
    }

    #map .separator {
        stroke: #ccc;
        fill: none;
        stroke-width: 1.5;
    }

    #map .separator:hover {
        stroke: #ccc;
        fill: none;
    }

    .btn-primary{
        background-color: #86AAE0;
        border-color: #86AAE0;
    }

    .btn-primary.active, .btn-primary.focus, .btn-primary:active, .btn-primary:focus {
        background: #547096;
        border-color: #547096;
        color: #fff;
    }

